import {Drawer} from "rsuite";

const NewProject = ({show, toggleDrawer}) => {
    const newProjectStyles = {
        width: "30%",
    }
    return(
        <>
            <Drawer show={show} onHide={toggleDrawer} style={newProjectStyles}>
                <Drawer.Header>New Project</Drawer.Header>
                <Drawer.Body>

                </Drawer.Body>
            </Drawer>
        </>
    )
}

export default NewProject;
